import { Button} from "@microsoft/fast-components-react-msft";
import { Column } from "@microsoft/fast-layouts-react";
import { info } from "../data/info";

export default function IncreaseButton(i, onClickIncrease) {

    <Column>
        <Button onClick={onClickIncrease}>
            {info.sections[i>=2 ? 0 : i+1].headingText}
            </Button>
    </Column>
}
